class Utils {
    get baseUrl() {
        return 'http://localhost:8080/';
    }

    enableButton(button) {
        button.classList.remove('btndisabled');
        button.disabled = false;
    }

    disableButton(button) {
        button.classList.add('btndisabled');
        button.disabled = true;
    }

    getColorIsNotaAprobada(nota) {
        let color = '';
        color = nota >= 5 ? 'success' : 'danger';
        return `<span class="text-${color}">${nota}</span>`;
    }

    limitarDecimales(numero) {
        // Redondea el número a dos decimales
        var numeroRedondeado = Number(numero.toFixed(2));
        // Si el número redondeado es igual a 100, retorna el número sin decimales
        if (numeroRedondeado === 100) {
            return numeroRedondeado.toFixed(0);
        }
        // Si no, retorna el número redondeado con dos decimales
        return numeroRedondeado.toFixed(2);
    }

    notaRecupNoRealiz(nota) {
        return nota == 0 ? '--' : nota;
    }

    formatDate(date, formatString) {
        const day = date.getDate();
        const month = date.getMonth() + 1;
        const year = date.getFullYear();

        const formattedDate = formatString
            .replace(/DD/g, day)
            .replace(/MM/g, month)
            .replace(/YYYY/g, year);

        return formattedDate;
    }

    get nombreInstitucion() {
        return 'Centro Escolar Doctor Salvador Mendieta\nCoatepeque';
    }

    // =========================================================
    // Declarar cosas arriba de este commentario XD
    // =========================================================

    get logoBase64() {
        return 'data:image/jpeg;base64,';
    }
}
